import React, { useState } from 'react';

const Results = ({ data }) => {
    const [filteredPlayers1, setFilteredPlayers1] = useState([]);
    const [value1, setValue1] = useState('');
    const [filteredPlayers2, setFilteredPlayers2] = useState([]);
    const [value2, setValue2] = useState('');
    const players = ['John', 'Paul', 'George', 'Ringo'];

    const handleInputChange = (e, identifier) => {
        const inputValue = e.target.value.toLowerCase();
        const filtered = players.filter((player) => player.toLowerCase().includes(inputValue));
        if (identifier === 'input1') {
            setValue1(e.target.value);
            setFilteredPlayers1(filtered);
        } else if (identifier === 'input2') {
            setValue2(e.target.value);
            setFilteredPlayers2(filtered);
        }
    };

    return (
        <div>
            <input
                type='text'
                value={value1}
                onChange={(e) => handleInputChange(e, 'input1')}
                placeholder={'Search for a player'}
                list='player-list1'
            />
            <datalist id='player-list1'>
                {filteredPlayers1.map((player) => (
                    <option key={player} value={player} />
                ))}
            </datalist>
            <input
                type='text'
                value={value2}
                onChange={(e) => handleInputChange(e, 'input2')}
                placeholder={'Search for a player'}
                list='player-list2'
            />
            <datalist id='player-list2'>
                {filteredPlayers2.map((player) => (
                    <option key={player} value={player} />
                ))}
            </datalist>
        </div>
    );
};

export default Results;
